      const response = await fetch("http://localhost:8000/meals")
      const meals = await response.json()
      setMeals(meals.data)
    }
    React.useEffect(() => {
      fetchMeals()
    }, [])



    return (

        <div>
            {/* # HEADER COMPONENT */}
        <Header></Header>
            <h2>Hello</h2>
        </div>
    )

}

